O aplicativo do Super Muffato está de cara nova, para trazer a melhor experiência para suas compras!

Faça o download e tenha todas as vantagens que o Super Muffato oferece para você:
- As melhores promoções: confira as ofertas e vouchers exclusivos no ClubeFato;
- Faça suas compras no Super Muffato Delivery, e escolha se quer receber em casa ou retirar em uma de nossas lojas, tudo sempre fresquinho para você;
- Smartphones, TVs, Eletrodomésticos, Casa & Bazar, e muito mais: agora o Supermuffato.com está mais perto de você;
- Use o Churrascômetro para calcular os ingredientes para seu churrasco;
- Veja receitas, salve e compartilhe as suas favoritas;
- Crie listas de compras ou aproveite nossas listas prontas;
- Sempre tem um Super Muffato pertinho de você: encontre a loja mais próxima e confira os horários de funcionamento.

Experimente o novo jeito Super Muffato de comprar. É rápido, fácil e de graça.
